import { Component } from 'react';
import logo from '../images/logo.svg';
import './App.css';

class App extends Component {
    constructor() {
      super();
      this.state = {
        name: "Shaun"
      }

    }
    render(){
      const { name } = this.state;
      return (
        <div className="App">
          <header className="App-header">
            <img src={logo} className="App-logo" alt="logo" />
            <h2>{`Hi ${name}`}</h2>
            <button>{`Change ${name}`}</button>
          </header>
        </div>
      );
    }
}
export default App;
